import React from 'react';
import { reduxForm, Field } from 'redux-form';
import { required } from '../../validators';
// import inputFormField from '../InputFormField';

const UserDetailsForm = props => {
  const { handleSubmit, pristine, submitting } = props;
  return(
    <form>
        <Field
          name='username'
          type='text'
          label='Username'
          placeholder=''
          validate={required}
          component="input"
        />
        <Field
          name='password'
          type='password'
          label='Password'
          placholder='Password'
          validate={required}
          component="input"
        />
        <button disabled={pristine || submitting} onClick={handleSubmit(values => {
          props.onSubmit({
            ...values,
            type: 'login'
          })
        })}>
          Login
        </button>
        <button type="submit" disabled={pristine || submitting} onClick={handleSubmit(values => {
          props.onSubmit({
            ...values,
            type: 'register'
          })
        })}>
          Register
        </button>
    </form>
  )
}

export default reduxForm({
  form: 'UserDetailsForm'
})(UserDetailsForm);
